import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';
import apiClient from '../api/apiClient';

const CampaignDetailPage = () => {
  const { campaignId } = useParams();
  const [campaign, setCampaign] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchCampaignDetails = async () => {
      try {
        setLoading(true);
        const response = await apiClient.get(`/campaigns/${campaignId}`);
        setCampaign(response.data);
        setError(null);
      } catch (err) {
        setError('Failed to fetch campaign details.');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchCampaignDetails();
    
    // In a real app, you would set up a WebSocket connection here
    // to listen for real-time log updates. For now, we'll just fetch once.

  }, [campaignId]);

  if (loading) return <div>Loading campaign details...</div>;
  if (error) return <div className="text-red-500">{error}</div>;
  if (!campaign) return <div>Campaign not found.</div>;

  const getStatusColor = (status) => {
    switch(status) {
      case 'success': return 'text-green-600';
      case 'submission_failed': return 'text-red-600';
      case 'form_not_found': return 'text-yellow-600';
      default: return 'text-gray-600';
    }
  }

  return (
    <div>
      <div className="mb-6">
        <Link to="/campaigns" className="text-indigo-600 hover:underline">&larr; Back to Campaigns</Link>
      </div>
      <div className="bg-white p-8 rounded-lg shadow-md">
        <h1 className="text-2xl font-bold text-gray-900">{campaign.name}</h1>
        <p className="text-sm text-gray-500 mb-4">Status: <span className="font-medium text-gray-700">{campaign.status}</span></p>

        <div className="mt-6">
          <h2 className="text-xl font-semibold mb-4">Submission Logs</h2>
          <div className="border rounded-md">
            <table className="min-w-full divide-y divide-gray-200">
              <thead className="bg-gray-50">
                <tr>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Target URL</th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Details</th>
                </tr>
              </thead>
              <tbody className="bg-white divide-y divide-gray-200">
                {campaign.logs && campaign.logs.length > 0 ? (
                  campaign.logs.map(log => (
                    <tr key={log.id}>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-800">{log.target_url}</td>
                      <td className={`px-6 py-4 whitespace-nowrap text-sm font-semibold ${getStatusColor(log.status)}`}>{log.status.replace('_', ' ')}</td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">{log.details}</td>
                    </tr>
                  ))
                ) : (
                  <tr>
                    <td colSpan="3" className="px-6 py-4 text-center text-gray-500">No logs yet. Submissions may be in progress.</td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CampaignDetailPage;
